import{AiOutlineClose, AiOutlineMenu} from 'react-icons/ai'
const Navbar = () => {

    const [nav, setNav] = useState(false)

    const handleNav = () => {
        setNav(!nav);
    };

    return (
        <div className = 'flex justify-between items-center h-24 max-w-[1240px]  mx-auto px-4 text-white'> 
        <h1 className='w-full text-3xl font-bold text-[#00df9a]' >  </h1> 

            <ul className = " hidden "> 
                <l1 className = 'p-4'> Home </l1>
                <l1 className = 'p-4'> Projects</l1>
                <l1 className = 'p-4'> Contact </l1>
            </ul>

            <div onClick={handleNav} className='block md:hidden'>
          {nav ? <AiOutlineClose size={20}/> : <AiOutlineMenu size={20} />}
      </div>


            <ul className = ' fixed left-0 top-0 w-[60%] h-full border-r border-r-gray-900 bg-[#00300]'> 
            <h1 className='w-full text-3xl font-bold text-[#00df9a] m-4' >  Arjun Sudhalkar</h1> 
                <l1 className = 'p-4 border-b border-gray-600'> Home </l1>
                <l1 className = 'p-4 border-b border-gray-600'> Projects</l1>
                <l1 className = 'p-4 border-b border-gray-600'> Contact </l1>
            </ul>
            </div>





    )
}

export default Navbar
